materials.description:
The handmade panels provide a decorative touch to spaces, bringing the “montado” (the cork oak forest) indoors and transporting us to a natural environment with all its benefits.

The privilege of having a natural material on the walls:

LIGHTWEIGHT MATERIAL;

NATURAL ELASTICITY;

DURABILITY;

THERMAL AND ACOUSTIC INSULATION.

Naturally stylish, silent and comfortable yet easy to maintain and environmentally friendly. The remarkable native properties of cork wall panels will create a warm, quiet and relaxing ambiance.

Board size: 930x630x7mm
Bevel: No bevel
